INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(2, 'Novo site', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Estamos com um novo site agora mais simples e mais dinâmico onde os alunos dos cursos técnicos possuem a possibilidade de acompanhar no ambiente online as suas avaliações nas disciplinas.</span><br></p>', 'natanael-admin', 0, '02/07/2012 12:40:02'),
(3, 'Edital de Seleção dos Cursos técnicos', '<div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><font face=\"Times New Roman, Times, serif\">Confira o edital de seleção para os cursos técnicos.</font></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><font face=\"Times New Roman, Times, serif\"><i>Baixar arquivo&nbsp;</i></font></span><a href=\"http://mariarocha.org.br/arquivos/1341283209844.pdf\" target=\"_blank\">Edital.pdf</a></div>', 'natanael-admin', 0, '02/07/2012 23:39:51'),
(4, 'Gabarito da prova de seleção', '<p>Em anexo o gabarito da prova de seleção dos candidatos<span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;</span>aos curso técnicos.</p><p><i>Baixar arquivo&nbsp;</i><a href=\"http://mariarocha.org.br/arquivos/1341283987501.pdf\" target=\"_blank\">Gabarito.pdf</a></p>', 'natanael-admin', 0, '02/07/2012 23:52:40'),
(5, 'Escola premia aluno vencedor do Concurso de Desenho 2012', '<p>A Escola Maria Rocha promoveu no mês de Abril de 2012 o concurso de desenho com o tema \"XXXII Concurso Literário Municipal\".</p><p>O objetivo do concurso foi a escolha do desenho para a divulgação publicitária do XXXII Concurso Literário Municipal, coordenado por nossa Escola e que conta com a participação das escolas do Ensino Médio de Santa Maria.</p><p>A vice-diretora do turno da manhã, Cleunice Fialho, juntamente com as coordenadoras do Concurso Literário, professoras Maria Helena e Larissa Freitas, estiveram em sala de aula, e juntamente com a turma da 2ª série B, parabenizam e premiaram o aluno vencedor, Henrique Crespan Spall.</p><p><i>Baixar Arquivo&nbsp;</i><a href=\"http://mariarocha.org.br/arquivos/1341534610790.jpg\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); font-size: medium; color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif;\">IMG_20120605_114746.jpg</a></p><p><i>Baixar Arquivo&nbsp;</i><a href=\"http://mariarocha.org.br/arquivos/1341534610939.jpg\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); font-size: medium; color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif;\">IMG_20120605_115456.jpg</a></p><p><i>Baixar Arquivo&nbsp;</i><a href=\"http://mariarocha.org.br/arquivos/1341534610609.jpg\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); font-size: medium; color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif;\">IMG_20120605_115523 - Copiar (2).jpg</a></p><p><i>Baixar Arquivo&nbsp;</i><a href=\"http://mariarocha.org.br/arquivos/1341534610124.jpg\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">IMG_20120605_115619.jpg</a><i><br></i><i><br></i><i><br></i></p>', 'pippi ', 0, '05/07/2012 21:29:39'),
(6, 'Problema com divulgação do Resultado da Seleção', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Devido à problemas técnicos em Porto Alegre, a divulgação da lista dos aprovados para os Cursos Técnicos foi alterada para esta Quarta-feira (11/07/2012).</span><br></p>', 'natanael-admin', 0, '09/07/2012 11:37:47'),
(7, 'XXXIII Concurso Literário Municipal', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">A Escola Maria Rocha convida: participe do XXXIII Concurso Literário Municipal e viaje pelo mundo da escrita.&nbsp;</span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Sua crônica ou sua poesia poderá ser a vencedora! INSCRIÇÕES ABERTAS ATÉ 31 DE AGOSTO DE 2012.&nbsp;</span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Em anexo o cartaz do Concurso Literário.</span></p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1341949899211.jpg\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">IMG_20120605_114746.jpg</a></p>', 'pippi', 0, '10/07/2012 16:51:25'),
(8, 'Lista dos classificados', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Segue em anexo a lista dos classificados na seleção dos cursos técnicos.</span></p><p><i style=\"font-size: medium; color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif;\">Baixar arquivo</i><span style=\"font-size: medium; color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1342014087956.pdf\" target=\"_blank\" style=\"font-size: medium; color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; background-color: rgb(255, 255, 255);\">lista dos classificados.pdf</a></p>', 'natanael-admin', 0, '11/07/2012 10:41:15'),
