(20, 'FIM da GREVE', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Na&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">Assembléia dos Professores</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;realizada hoje (13/09), em Porto Alegre, foi decidido pelo&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">fim da Greve.</span></p><p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">As aulas iniciam normalmente na&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">Segunda-Feira (16/09)</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">.</span></p>', 'pippi', 0, '13/09/2013 17:52:50'),
