(47, 'Gabarito Processo Seletivo - 2º SEM/2015', '<p>Gabarito Processo Seletivo - 2º SEM/2015</p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1449766452733.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Gabarito.pdf</a></p>', 'pippi', 0, '10/12/2015 14:54:04'),
(48, 'Candidatos classificados - 1ª Semestre 2016', '<p>Candidatos classificados - 1ª Semestre 2016</p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1450110445483.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Classificados.pdf</a></p>', 'pippi', 0, '14/12/2015 14:27:11'),
(49, 'Edital de Abertura - Aquisição de Gêneros Alimentícios', '<p>Edital de Abertura - Aquisição de Gêneros Alimentícios</p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1459532710116.docx\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">edital de abertura 01.docx</a></p>', 'pippi', 0, '01/04/2016 14:45:03'),
(50, 'AVISO chamada publica 01.2016', '<p>AVISO chamada publica 01.2016</p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1459880422300.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">AVISO chamada publica 01.2016.pdf</a></p>', 'pippi', 0, '05/04/2016 15:20:10'),
