INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(52, 'Edital - Processo Seletivo 2° sem/2016 - Cursos Técnicos', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Acesse o site&nbsp;</span><a href=\"http://www.educacao.rs.gov.br/\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; background-color: rgb(255, 255, 255);\">http://www.educacao.rs.gov.br</a><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;- no item&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">Matrículas</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, para efetuar sua inscrição.</span></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"a.jpg\" style=\"width: 282px; float: none;\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><br></span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"></p>', 'natanael', 0, '04/06/2016 18:32:51'),
(53, 'Edital de Abertura - aquisição de AR CONDICIONADO', '<p>Edital de Abertura - aquisição de AR CONDICIONADO</p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1465231442762.docx\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">edital de abertura.docx</a></p>', 'pippi', 0, '06/06/2016 13:43:27'),
(54, 'Informações sobre a greve', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">A direção da Escola Maria Rocha vem por meio dessa nota comunicar que&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">ao contrário do que foi veiculado em jornais e televisão está havendo negociações</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;entre governo do estado, professores e alunos.</span></p><p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Foi veiculado no Jornal A Razão do dia 10/06/2016 que Simone Rodrigues (titular da 8ª CRE) disse:&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-style: italic;\">As negociações estão encerradas e as aulas devem ser retomadas na manhã de segunda-feira impreterivelmente</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, mas na verdade as negociações com o Governo continuam, pois já está marcada reunião do CPERS com o Governo do Estado na Segunda-feira.</span></p><p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Quando existir alguma novidade sobre o fim da greve, bem como o retorno das aulas será publicado nota aqui no site da escola.</span></p>', 'natanael', 0, '10/06/2016 20:51:05'),
(55, 'Data e Horário da Prova', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">A prova para o Processo Seletivo dos Cursos Técnicos será&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">dia 02/07 - Sábado</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, às&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">14h 30min</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, na própria Escola.</span></p><p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">É necessário que o candidato chegue&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">30min antes</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;e leve consigo seu&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">RG</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">.</span></p>', 'pippi', 0, '20/06/2016 21:18:16'),
(56, 'Carta Convite para aquisição de Ar Condicionado', '<p>Carta Convite para aquisição de Ar Condicionado</p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1466700570374.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Carta Convite.pdf</a></p>', 'pippi', 0, '23/06/2016 13:48:42'),
(57, 'Prova CONFIRMADA', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Está CONFIRMADA a prova para o Processo Seletivo dos Cursos Técnicos será&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">dia 02/07 - Sábado</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, às&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">14h 30min</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, na própria Escola.</span></p><p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">É necessário que o candidato chegue&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">30min antes</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;e leve consigo seu&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">RG</span></p>', 'pippi', 0, '29/06/2016 23:58:35'),
(58, 'Gabarito', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Gabarito Oficial</span></p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1467593063935.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Gabarito Oficial.pdf</a></p>', 'pippi', 0, '03/07/2016 21:44:11'),
(59, 'Volta às aulas', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Aviso aos alunos: Segunda-feira(11/07/2016) retornam às aulas.</span></p>', 'natanael', 0, '09/07/2016 19:55:50'),
(60, 'Lista dos Alunos Classificados', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Lista dos Alunos Classificados referentes ao Processo Seletivo - 2º sem/2016. Os demais candidatos serão chamados pela classificação conforme liberação de vagas.</span></p><p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Os que não estão na lista podem verificar a classificação no site da SEDUC.</span></p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1468294947986.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Classificados.pdf</a></p>', 'pippi', 0, '12/07/2016 00:42:15'),
(61, 'Recesso escolar', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">A direção da escola comunica que não haverá aula no período de 25 a 31 de Julho devido recesso escolar determinado pela Secretaria de Educação.</span></p>', 'natanael', 0, '23/07/2016 17:07:14'),
(62, 'Horário da Secretaria da Escola', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Durante o recesso escolar - dia 26/07 a 29/07, o funcionamento da Secretaria da Escola será das 08h00 às 11h30min.</span></p>', 'pippi', 0, '25/07/2016 11:34:26'),
(63, 'CONVOCAÇÃO DE CANDIDATOS', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">CONVOCAÇÃO DE CANDIDATOS SUPLENTES PARA</span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">INGRESSO NOS CURSOS TÉCNICOS II SEMESTRE DE 2016</span></p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1470079316700.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Convocac?a?o de Suplentes.pdf</a></p>', 'pippi', 0, '01/08/2016 16:21:49'),
(64, 'Aviso da chamada Pública 02/2016', '<p>Aviso da chamada Pública 02/2016</p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1471628978564.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">aviso chamada publica 02.2016.pdf</a></p>', 'pippi', 0, '19/08/2016 14:48:42'),
(65, 'A V I S O', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">Aviso</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">: comunicamos aos candidatos que colocaram como&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">2ª opção cursar Contabilidade</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;no turno da manhã que a referida turma não abrirá, pois não preencheu o número de vagas.</span></p>', 'pippi', 0, '19/08/2016 21:42:06'),
(66, 'Convocação de candidatos para ingresso nos Cursos Técnico', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Convocação de candidatos para ingresso nos Cursos Técnicos – II Semestre de 2016</span></p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1471654157886.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Convocação 2 de Suplentes.pdf</a></p>', 'pippi', 0, '19/08/2016 21:49:11');
INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(67, 'Homenagem | Diandra', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Nossa guerreira&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">Diandra Schilling</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;hoje descansa e vai ao encontro dos braços do pai para enfim brilhar na eternidade. A lembrança que fica para a nossa Escola é de uma menina que sorria com o olhar forte, que nunca perdeu a esperança e que com o seu jeito especial de ser deixa uma lição de vida para todos aqueles com os quais conviveu. Ela partiu, mas o seu exemplo ficará para sempre no meio de nós.</span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">A Escola Maria Rocha sente profundamente sua partida tão precoce e se solidariza com a família neste momento de dor.</span></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 954px;\" data-filename=\"s.jpg\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><br></span></p>', 'pippi', 0, '19/08/2016 22:02:17');
INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(68, 'Edital - carta convite', '<p>Edital - carta convite</p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1473115078932.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Edital - carta convite.pdf</a></p>', 'pippi', 0, '05/09/2016 19:37:43'),
(69, 'Aula Inaugural', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Convidamos os estudantes de todos os Curso Técnicos (1º, 2º e 3º semestres) para aula inaugural do II semestre de 2016.</span></p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1473115939924.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Aula Inaugural.pdf</a></p>', 'pippi', 0, '05/09/2016 19:52:12');
INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(70, 'Processo Seletivo 2017', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Edital referente ao Processo Seletivo 2017 para ingresso dos alunos na E.E.E.M Maria Rocha.</span></p><p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Acesse o site&nbsp;</span><a href=\"http://www.educacao.rs.gov.br/\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; background-color: rgb(255, 255, 255);\">http://www.educacao.rs.gov.br</a><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;- no item&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">Matrículas</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, para efetuar sua inscrição.</span></p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"c.jpg\" style=\"width: 411px;\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><br></span></p>', 'pippi', 0, '28/10/2016 20:45:59');
