(71, 'Edital de Abertura', '<p>Edital de Abertura</p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1478830676909.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">edital de abertura.pdf</a></p>', 'pippi', 0, '11/11/2016 00:17:39'),
(72, 'Edital - Eleições CPM', '<p>Edital - Eleições CPM</p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1479146645744.jpg\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Edital CPM 2016.jpg</a></p>', 'pippi', 0, '14/11/2016 16:03:52'),
(73, 'Data e Horário | PROVA', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Está CONFIRMADA a prova para o Processo Seletivo dos Cursos Técnicos. Será&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">dia 10/12 - Sábado, às 14h 30min</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, na própria Escola.</span></p><p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">É necessário que o candidato chegue&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">30min</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;antes e leve consigo seu&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">RG</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">.</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><br></span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"></p>', 'pippi', 0, '29/11/2016 20:04:11'),
(74, 'Inscrição nos Cursos', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">A escola estará aberta amanhã, nos 03 turnos, para ajudar aqueles que não estão conseguindo efetuar a inscrição para os Cursos oferecidos para o 1º Semestre de 2017.</span></p>', 'pippi', 0, '30/11/2016 00:08:41'),
(75, 'Classificados - Técnico de Informática Integrado ao Ensino Médio', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Classificados através de sorteio para ingresso no I semestre de 2017 no Curso Técnico de Informática Integrado ao Ensino Médio.</span></p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1480979142737.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">lista de classificados.pdf</a></p>', 'pippi', 0, '05/12/2016 21:05:03'),
(76, 'PROVA Confirmada', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Está CONFIRMADA a prova para o Processo Seletivo dos Cursos Técnicos para amanhã,&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">dia 10/12 - Sábado</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, às&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">14h 30min</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, na própria Escola.</span></p><p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">É necessário que o candidato chegue&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">30min antes</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">&nbsp;e leve consigo seu&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">RG</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">.</span></p>', 'pippi', 0, '09/12/2016 19:37:46'),
(77, 'GABARITO Oficial', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">GABARITO Oficial da prova</span></p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1481505319810.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">GabaritoOficial.pdf</a></p>', 'pippi', 0, '11/12/2016 23:15:04'),
(78, 'Alunos Classificados', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Lista de alunos classificados no Processo Seletivo para ingresso no I SEMESTRE DE 2017.</span></p><p><i style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">Baixar arquivo</i><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium;\">&nbsp;</span><a href=\"http://mariarocha.org.br/arquivos/1481987687618.pdf\" target=\"_blank\" style=\"color: rgb(45, 70, 150); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; background-color: rgb(255, 255, 255);\">Classificados.pdf</a></p>', 'pippi', 0, '17/12/2016 13:14:17'),
(79, 'Volta às aulas', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">A Direção da Escola Maria Rocha vem lembrar a todos os alunos que&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">as aulas retornam no dia 06/03/2017</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">.</span></p>', 'natanael', 0, '23/02/2017 23:20:21');
