INSERT INTO `mr_posts` (`id`, `titulo`, `descricao`, `postador`, `categoria`, `data`) VALUES
(81, 'Processo Seletivo | PROVA confirmada', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">Informações sobre a realização da prova do Processo Seletivo - II Semestre de 2017</span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Comunicamos que as provas do Processo Seletivo para ingresso no II Semestre de 2017 ocorrerão no dia 01/07/2017 (Sábado), às 14h 30min.</span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Pedimos que os candidatos cheguem 30 min antes. O portão será aberto às 14h e fechado às 14h 30min, não sendo permitida a entrada de nenhum candidato depois deste horário.</span></p>', 'pippi', 0, '30/06/2017 13:08:35');
