(99, 'Processo Seletivo 2018 | Informações sobre a PROVA', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Comunicamos que as provas do Processo Seletivo para ingresso no I Semestre de 2018 ocorrerão na próxima&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">Quinta-feira - dia 07/07/2017</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">, às&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">20h00</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">.</span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Pedimos que os candidatos cheguem&nbsp;</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify; font-weight: bold;\">30 min antes</span><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">. O portão será aberto às 19h30 e fechado às 20h00, não sendo permitida a entrada de nenhum candidato depois deste horário.</span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"></p>', 'pippi', 0, '03/12/2017 16:16:43'),
(100, 'Gabarito', '<p><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\">Gabarito | Processo Seletivo 2018</span></p><p><img src=\"http://i.imgur.com/BDeamwY.jpg\" style=\"width: 416px;\"><span style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"><br></span><br style=\"color: rgba(0, 0, 0, 0.8); font-family: &quot;Times New Roman&quot;, Times, serif; font-size: medium; text-align: justify;\"></p>', 'pippi', 1, '08/12/2017 14:34:53'),
